// src/Icons.js

export const CloseIcon = () => (
  <svg className="close-icon" xmlns="http://www.w3.org/2000/svg" width="14" height="14" viewBox="0 0 14 14">
    <circle cx="7" cy="7" r="7" fill="red" />
    <line x1="4" y1="4" x2="10" y2="10" stroke="white" stroke-width="2" />
    <line x1="10" y1="4" x2="4" y2="10" stroke="white" stroke-width="2" />
  </svg>
);


